window.bookSummaryJSON = "<p><b><i>Peter Pan</i></b><b> meets </b><b><i>Groundhog Day </i></b><b>when 11-year-old Jackson makes a birthday wish about never growing up that mysteriously comes true. </b></p> <p>On his 11th birthday, Jackson is nervous about moving up to middle school where he knows he'll be bullied by older kids, so he makes his wish, \"I don't want to grow up!\" When his 12th birthday rolls around, he discovers his wish came true: he's still 11, and heâ€™s starting fifth grade (again). At first, this is the perfect life. Jackson is the smartest kid in his class, the best on his baseball team, and the star of the school band. But after a few years of being 11, he realizes his life is passing him by. His little sister is suddenly his big sister, his former friends are driving, everyone else is growing older but he's still living the same fifth grade life. Will Jackson ever figure out how to grow up or will he remain<i> Stuck</i>?</p>"; 
